import { makeAutoObservable } from "mobx";

export interface IDevice {
    id: number;
    name: string;
    price: number;
    brandId: number;
    typeId: number;
    img: string;
    info: string;
}

export interface IBrand {
    id: number;
    name: string;
}

export interface IType {
    id: number;
    name: string;
}
export default class DeviceStore {
    private _types: IType[] = []
    private _brands: IBrand[] = []
    private _devices: IDevice[] = []

    constructor() {
        this._types = [];
        this._brands = [];
        this._devices= [];

        makeAutoObservable(this)
    }

    setTypes(types){
        this._types = types
    }
    setBrands(brands){
        this._brands = brands
    }
    setDevices(devices){
        this._devices = devices
    }
    get Types(){
        return this._types
    }

    get Brands(){
        return this._brands
    }
    get Devices(){
        return this._devices
    }

}
